import React, {useEffect, useState} from 'react';
import {Box, Heading, Table, TableCaption, Tbody, Td, Tfoot, Th, Thead, Tr} from "@chakra-ui/react";
import axios from "axios";

const ReportPage = () => {
    const [reportData, setData] = useState(null);
    useEffect(async () => {
        const url = 'http://localhost:8080/api/v1/admin/quiz-assignment/assign-quizzes/report';
        try {
            const resp = await axios.get(url, {
                headers: {
                    "Content-Type": "application/json",
                    "Authorization": `Bearer ${localStorage.getItem('accessToken')}`
                }
            })
            console.log(resp.data);
            setData(resp.data);
        } catch (e) {
            console.log('Failed to get report data ', e)
        }
    }, []);
    return (
        <Box w={'100%'}>
            <Table variant="striped" colorScheme="teal">
                <TableCaption>Quiz Reporting</TableCaption>
                <Thead>
                    <Tr>
                        <Th>Quiz name</Th>
                        <Th>Total participants</Th>
                        <Th isNumeric>Code</Th>
                    </Tr>
                </Thead>
                <Tbody>
                    {
                        reportData && reportData.map((item) => (
                            <Tr>
                                <Td>{item.title}</Td>
                                <Td>millimetres (mm)</Td>
                                <Td isNumeric>25.4</Td>
                            </Tr>
                        ))
                    }

                </Tbody>
                <Tfoot>
                    <Tr>
                        <Th>To convert</Th>
                        <Th>into</Th>
                        <Th isNumeric>multiply by</Th>
                    </Tr>
                </Tfoot>
            </Table>
        </Box>
    );
};

export default ReportPage;
